import * as clipboard from "@ibrains-design/clipboard"
import { useMachine, normalizeProps } from "@ibrains-design/solid"
import { ClipboardCheck, ClipboardCopyIcon } from "lucide-solid"
import { createMemo, createUniqueId } from "solid-js"

function Clipboard() {
  const [state, send] = useMachine(
    clipboard.machine({
      id: createUniqueId(),
      value: "https://github.com/chakra-ui/ibrainsd",
    }),
  )

  const api = createMemo(() => clipboard.connect(state, send, normalizeProps))

  return (
    <div {...api().getRootProps()}>
      <label {...api().getLabelProps()}>Copy this link</label>
      <div {...api().getControlProps()}>
        <input {...api().getInputProps()} />
        <button {...api().getTriggerProps()}>
          <Show when={api().copied} fallback={<ClipboardCopyIcon />}>
            <ClipboardCheck />
          </Show>
        </button>
      </div>
    </div>
  )
}
